import React, { useState } from 'react'
import InputText from '../inputs/input_translate';

export default function Translate_Label() {
  const [text, setText] = useState('');

  return (
    <div className='grid grid-cols-2'>
        <div className=''>
        <InputText 
        value={text}
        onChange = {() => console(text)} 
        />
        </div>
        <div>
        YES
        </div>
    </div>
  )
}
